script: |
  super -f text -I q853.spq | sort > q853.out

inputs:
  - name: q853.spq
    data: |
      SELECT DISTINCT 35 + - col0 AS col1, + col0 FROM tab1 (FORMAT parquet) AS cor0 WHERE - CAST ( NULL AS INTEGER ) + 56 NOT IN ( col0 * CAST ( - 31 AS INTEGER ) * + col1 );
  - name: tab1

outputs:
  - name: q853.out
    data: |
